import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <h1 className='heading'>Theme Extracting Utility</h1>
        <form>
          <input type='text' name='company-name' placeholder='Please enter company name' />
          <input type='submit' value='Submit' />
        </form>
    </div>
  );
}

export default App;
